         "record"             => $user["id"]
        ,"redcap_event_name"  => $user["redcap_event_name"]
        ,"field_name"         => "well_bmi"
        ,"value"              => $well_bmi
      );
      $data[] = array(
         "record"             => $user["id"]
        ,"redcap_event_name"  => $user["redcap_event_name"]
        ,"field_name"         => "well_education"
        ,"value"              => $well_education
      );
    }
      
